import axios from 'axios';

export const initUrl = 'https://rickandmortyapi.com/api/character';



export const fetchAPI = async (page = 0, filter) => {
  let response
  if (filter) {
    response = await axios.get(`${initUrl}/?name=${filter}?page=${page}`);
  }
  response = await axios.get(`${initUrl}?page=${page}`);
  const { data } = response;
  return data;
};
